import './css/App.css';
import CardContainer from './CardContainer'

function App() {
  return (
    <div className="App">
      <h1>Items for Sale!</h1>
        <Route path="/details">
          <ProductDetails />
        </Route>
      <CardContainer/>
    </div>
  );
}

export default App;
